INSERT IGNORE INTO `t_amz_settlement_amount_description` (`id`, `cname`, `ename`, `cdescription`, `edescription`) VALUES
	(1, '佣金', 'Commission', '针对所售商品价值收取的费用', 'Fee charged against the value of the item sold.'),
	(2, 'FBA每件处理费', 'FBAPerUnitFulfilmentFee', '为了补偿亚马逊的配送成本而对每件商品收取的费用', 'Per-unit fee charged to compensate Amazon for the cost of fulfilling.'),
	(3, 'FBA基于重量的处理费', 'FBAWeightBasedFee', '为了补偿亚马逊的配送成本而对每个订单向亚马逊物流卖家收取的费用', 'Fee assessed for FBA sellers on a per-item basis to compensate Amazon for the cost of shipping per order.'),
	(4, '信用卡拒付(礼品包装)', 'GiftwrapChargeback', '针对亚马逊物流商品收取的礼品包装费是您总销售收益的一部分。我们将其作为收益（参见礼品', 'Giftwrap charges for Amazon Fulfilled units are part of your gross sales proceeds. We report them to you as revenue (see Giftwrap) and charge you a GiftwrapChargeback fee equal to the amounts charged to the customer.'),
	(5, '退款佣金', 'RefundCommission', '当发放退款时，针对退还的原始费用金额所收取的费用', 'When a refund is issued, the fee charged against the original fee amount being refunded.'),
	(6, '信用卡拒付(配送费)', 'DeliveryChargeback', '针对亚马逊物流商品收取的运费是您总销售收益的一部分。我们将其作为收益（参见运费）向您', 'Shipping charges for Amazon Fulfilled units are part of your gross sales proceeds. We report them to you as revenue (see Shipping) and charge you a ShippingChargeback fee equal to the amounts charged to the customer.'),
	(7, '变动结算费', 'VariableClosingFee', '针对商品销售收取的非固定交易手续费。有关详细信息，请参见 我要开店 费用价目表 。', 'Variable closing fee charge for the sale of an item. Refer to the Selling on Amazon Fee Schedule for more details.'),
	(8, '礼品包装费', 'GiftWrap', '针对亚马逊物流商品收取的礼品包装费是您总销售收益的一部分。我们将其作为礼品包装收益向', 'Giftwrap charges for Amazon Fulfilled units are part of your gross sales proceeds. We report them to you as Giftwrap revenue and charge you a fee (see GiftwrapChargeback) equal to the amounts charged to the customer.'),
	(9, '商誉费', 'Goodwill', '买家退款，不适用于特定费用', 'Customer refund, not applied against a specific charge.'),
	(10, '本金', 'Principal', '向买家收取（或退还）的商品金额', 'Amount charged (or refunded) to customer for item.'),
	(11, '重新入库费', 'RestockingFee', '对于不符合全额退款条件的退货，可能向买家收取重新入库费。将买家退款的盘点报告为卖家存', 'Customers may be charged a RestockingFee for returns that are not eligible for a full refund. This adjustment to the customer\'s refund is reported as a seller credit.'),
	(12, '配送费', 'Delivery', '针对亚马逊物流商品收取的运费是您总销售收益的一部分。我们将其作为运费收益向您报告并向', 'Shipping charges for Amazon Fulfilled units are part of your gross sales proceeds. We report them to you as Shipping revenue and charge you a fee (see ShippingChargeback) equal to the amounts charged to the customer.'),
	(13, '当前预留金额', 'Current Reserve Amount', '预留金额是结算周期内保留的金额，以支付预期费用，例如退货和退款', 'The reserve amount is the amount held back in a settlement period to cover potential expenses such as returns and refunds.'),
	(14, '上一期预留金', 'Previous Reserve Amount Balance', '以前结算报告上的预留金额', 'The reserve amount from the previous settlement report.'),
	(15, '退款补偿', 'Refund Reimbursal', '针对买家退款向卖家收取的偿还金额', 'Reimbursal of amount charged to seller for customer refund.'),
	(16, '仓储费', 'Storage Fee', '针对存储在亚马逊库房的卖家商品收取的仓储费用', 'Storage fee for seller\'s items stored in Amazon\'s warehouse.'),
	(17, 'FBA订单处理费', 'FBAPerOrderFulfilmentFee', '为了补偿亚马逊的配送成本而对每个订单收取的费用', 'Per-order fee charged to compensate Amazon for the cost of fulfilling per order.'),
	(18, 'FBA运输费(FBA MCF)', 'FBATransportationFee', '为了补偿亚马逊的配送成本而对每个订单收取的亚马逊物流多渠道配送费', 'Fee assessed for FBA Multi-Channel Fulfillment to compensate Amazon for the cost of shipping per order.'),
